import React from 'react';
import logo from '../images/logoname.png';
import { Link } from 'react-router-dom';
import { UserContext } from "../context/UserContext";
import { useContext } from "react";

export const Navbar = () => {
    const history = useHistory();

    const handleLogout = () => {
        // Cerrar sesión y redirigir al usuario a la página de inicio de sesión
        // Agrega aquí la lógica para cerrar la sesión
        history.push('/login');
    };

    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#4C4F62' }}>
                <div className="container-fluid">
                    {/* ... Otros elementos de la barra de navegación ... */}
                    <ul className="navbar-nav w-100 justify-content-between align-items-end">
                        {user && user.role === '1' ? (
                            <li className="nav-item mx-auto d-block">
                                <button className="btn nav-link active" onClick={toggleDropdown}>
                                    Panel de Administración
                                </button>
                                <ul className="dropdown-menu">
                                    <li>
                                        <Link to='/estacionamientos' className="dropdown-item">
                                            Lista de Estacionamientos
                                        </Link>
                                    </li>
                                    <li>
                                        <Link to='/usuarios' className="dropdown-item">
                                            Lista de Usuarios
                                        </Link>
                                    </li>
                                </ul>
                            </li>
                        ) : null}
                        {/* ... Otros elementos de la barra de navegación ... */}
                        {user ? (
                            <li className="nav-item mx-auto d-block">
                                <button className="btn text-white" style={{ backgroundColor: '#F5B041' }} onClick={handleLogout}>
                                    Cerrar Sesión
                                </button>
                            </li>
                        ) : (
                            <li className="nav-item mx-auto d-block">
                                {/* ... Botones para inicio de sesión y registro ... */}
                            </li>
                        )}
                    </ul>
                </div>
            </nav>
        </div>
    )
}

export default Navbar;
